import React from 'react';
import { Button, Modal } from 'react-bootstrap';
interface props {
    visible : boolean,
    closeModal : ()=>void;
}

function ModalMarket(props:props) {


    return (
        // <div style={{position:'absolute',marginTop: 10,}}>
        //     <>

                <Modal  show={props.visible} animation={true} autoFocus={true} onHide={props.closeModal} style={{height: 500,width: 500,backgroundColor: 'whitesmoke',marginLeft: 700}}>
                    <Button variant="secondary" onClick={props.closeModal}>
                        Close
                    </Button>
                </Modal>
            // </>
        // </div>
    );
}

export default ModalMarket;
